import React from 'react';

import Person from './Person/Person'

const people = (props) => {
    console.log("WHAT ARE THE PROPS:", props)
    return props.people.map( (person, index) => {
        return <Person
            key = {person.id} 
            name = {person.name} 
            number = {person.number}/>
    });
}

export default people;
